import React, { ChangeEvent, useState } from 'react';

type FormState = {
  [key: string]: string;
};

const FarmForm: React.FC = () => {
  const [formData, setFormData] = useState<FormState>({});

  const handleFarmSubmit = (event: React.FormEvent<HTMLFormElement>)=>{
    event.preventDefault()
    console.log(formData);
    setFormData({});

  }

  const handleChange = (e: ChangeEvent<HTMLInputElement>) => {
    const { name, value } = e.target;
    console.log(name,value)
    setFormData((prevFormData) => ({
      ...prevFormData,
      [name]: value,
    }));
  };

  const addFarmForm = (
    <form name="farm_add" className="pure-form" onSubmit={handleFarmSubmit}>
      <fieldset>
          <input placeholder="Premise Id" name="premise_id" onChange={handleChange}/>
          <input placeholder="Name" name="name" onChange={handleChange}/>
          <input placeholder="Address" name="address" onChange={handleChange}/>
          <input placeholder="City" name="city" onChange={handleChange}/>
          <input placeholder="State" name="state"  onChange={handleChange}/>
          <input placeholder="Postal Code" name="postal_code" onChange={handleChange}/>
          <input placeholder="Total Population" name="total_population" onChange={handleChange}/>
          <button type="submit" className="pure-button pure-button-primary">Add</button>
      </fieldset>
    </form>

  );

  return (
    <div>
        {addFarmForm}
    </div>

  );
};

export default FarmForm;
